// Home.js
import React from 'react';
import Notes from './Notes.js';
import Compare from './Compare.js'; // Import the Compare component

const Home = (props) => {
    const { showAlter } = props;
    return (
        <div>
            <h1>Home Page</h1>
            <Notes showAlter={showAlter} />
            {/* Render the Compare component on the home page */}
            <Compare />
        </div>
    )
}

export default Home;
